import React from 'react';
import ReactDOM from 'react-dom';
import AlertState from './components/context/alert/AlertState';

import AuthState from './components/context/auth/AuthState';
import App from './App';

ReactDOM.render(
  <AuthState>
    <App />
  </AuthState>  ,
  document.getElementById('root')
);
